<video loop id="noSleepVideo" style="display:none;">
    <source src="data:video/mp4;base64, ">
    <source src="data:video/ogg;base64, " type="video/ogg">
    <source src="data:video/webm;base64, " type="video/webm">
</video>
<script src="<?php echo getURL('node_modules/nosleep.js/dist/NoSleep.min.js'); ?>" type="text/javascript"></script>
<script>
    var noSleep = new NoSleep();
    var noSleepVideoStarted = false;
    document.addEventListener('click', function enableNoSleep() {
        document.removeEventListener('click', enableNoSleep, false);
        noSleep.enable();
    }, false);

    function disableNoSleep() {
        noSleep.disable();
    }


    $(document).ready(function () {
        $(document).click(function () {
            if (!noSleepVideoStarted) {
                console.log('noSleepVideo, start');
                var vid = document.getElementById("noSleepVideo");
                vid.play();
                noSleepVideoStarted = true;
            }
        });
    });


</script>